import React, { useState } from 'react';
import './Slider.css';
import { SliderData } from './SliderData';

function Slider() {

	return (
		<>
			<>
            {SliderData.map((slider,index)=>{
				return (
					<img src={slider.image} alt="travel image"/>
				)
			})}
			</>
		</>
	)
}

export default Slider;
